import React, { useState } from 'react'
import { TaskSet } from '../DoData'

interface TaskListProps{
    taskSet: TaskSet
}

const TaskList=({taskSet}:TaskListProps)=>{
    return <>
    {taskSet.tasks.map((task)=>{
        return <span key={task.text}>
            {task.text}
        </span>
    })}
    </>
}

export default TaskList
